// src/App.jsx (or App.js)
import React from "react";
import { BrowserRouter as Router, Route, Rout } from "react-router-dom";
import AdminLogin from "./components/admin/AdminLogin";  // Assuming this is your login page
import ProtectedRoute from "./components/admin/ProtectedRoute"; // Import ProtectedRoute

const App = () => {
  return (
    <Router>
      <Routes>
        <Route exact path="/" component={AdminLogin} />
        {/* Use ProtectedRoute for the routes you want to protect */}
        <Route path="/admin/dashboard" component={ProtectedRoute} />
      </Routes>
    </Router>
  );
};

export default App;
